import React from 'react';

class Pokedex extends React.Component {
  render() {
    const { pokemonList } = this.props;
    return (
      <section className='section-pokedex'>
         <ul className='list-of-pokemons'>
            {pokemonList}
         </ul>
      </section>
    )
  }
}

export default Pokedex;
